script: |
  super -f text -I q5846.spq | sort > q5846.out

inputs:
  - name: q5846.spq
    data: |
      SELECT DISTINCT 65 + + col2 + + + col1 - col0 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE ( + CAST ( NULL AS INTEGER ) + col2 - col0 NOT IN ( - 23 * + + col1 - - ( col0 ) ) );
  - name: tab1

outputs:
  - name: q5846.out
    data: |
